import React, { useState } from "react";
import axios from "axios";

const VF2_PowerSteeringForm = () => {
  const [formData, setFormData] = useState({
    PS_VIN: "",
    PS_VC: "",
    PS_AIRING_ACTUAL: "",
    PS_AIRING_LEAK_HOLD: "",
    PS_AIRING_LEAK_ACTUAL: "",
    PS_AIR_VENT_ACTUAL: "",
    PS_VACUUM_ACTUAL: "",
    PS_VACUUM_LEAK_ACTUAL: "",
    PS_REVACUUM_ACTUAL: "",
    PS_OIL_QTY_ACTUAL: "",
    PS_OIL_PRESSURE_ACTUAL: "",
    PS_DELTA_PRESSURE_ACTUAL: "",
    PS_PROCESS_COMPLETE: "",
    PS_CYCLE_TIME: "",
    PS_RESULT: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("/api/vf2-power-steering", formData);
      alert("VF2 Power Steering data submitted successfully!");
    } catch (error) {
      alert("Submission failed!");
      console.error(error);
    }
  };

  return (
    <form
      onSubmit={handleSubmit}
      className="p-4 bg-white rounded shadow-md space-y-3 w-full max-w-3xl mx-auto"
    >
      <h2 className="text-xl font-bold mb-4">VF2 - Power Steering Form</h2>
      {Object.keys(formData).map((field) => (
        <input
          key={field}
          type="text"
          name={field}
          placeholder={field.replace(/_/g, " ")}
          value={formData[field]}
          onChange={handleChange}
          className="w-full p-2 border border-gray-300 rounded"
        />
      ))}
      <button
        type="submit"
        className="bg-green-600 text-white px-4 py-2 rounded hover:bg-green-700"
      >
        Submit
      </button>
    </form>
  );
};

export default VF2_PowerSteeringForm;
